def total_penalty_count(x):
    penalties = x.split('+')
    return int(penalties[3])

def is_time_less_than_a_week(x):
    time_units = ['days', 'hours']
    for unit in time_units:
        if unit in x:
            time_value = int(''.join(filter(str.isdigit, x)))
            if unit == 'days':
                return time_value < 7
            else:
                return False
    return False

def is_basketball_team(x):
    basketball_teams = ['Lakers', 'Nuggets', 'Mets']
    return x in basketball_teams

